const isEmptyObject = (obj) => {
  return Object.keys(obj).length === 0;
};

const getLocalStorageData = (name) => {
  const data = localStorage.getItem(name);
  if (data) {
    return data;
  } else {
    return [];
  }
};

export { isEmptyObject };
